    false,nt"url": null,nt"notes": "The Fish and Wildlife Service (Service)
    is proposing an approximate 700-acre addition to the existing acquisition boundary
    at Hillside National Wildlife Refuge (refuge) for public access, administrative
    control and habitat management values. Refuge lands were purchased by the COE under
    the Hillside Floodway, Yazoo Basin Project and transferred to the Service in 1975
    for operation as a national wildlife refuge. The refuge serves as a silt collection
    sump via a cutoff levee containing the altered channels of Black and Fannegusha
